// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VickreyAuction {
    address payable public owner;
    uint256 public auctionStart;
    uint256 public auctionEnd;
    uint256 public maxBid;
    uint256 public constant MAX_BIDDERS = 30;
    uint256 public constant DEPOSIT_PERCENTAGE = 10;

    enum AuctionState { Open, Closed, Completed }
    AuctionState public state;

    struct Bid {
        address payable bidder;
        uint256 amount;
        uint256 timestamp;
        bool depositReturned;
    }

    Bid[] public bids;
    address[] public bidders;
    address payable public winner;
    uint256 public winningPrice;

    event BidPlaced(address indexed bidder, uint256 amount);
    event AuctionClosed(address indexed winner, uint256 winningPrice);
    event DepositReturned(address indexed bidder, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Solo el propietario puede realizar esta accion");
        _;
    }

    modifier auctionOpen() {
        require(state == AuctionState.Open, "Subasta no activa");
        require(block.timestamp >= auctionStart && block.timestamp <= auctionEnd, "Fuera del periodo de subasta");
        _;
    }

    constructor(
        uint256 _startDate,
        uint256 _durationDays,
        uint256 _maxBid
    ) {
        owner = payable(msg.sender);
        auctionStart = _startDate;
        auctionEnd = _startDate + (_durationDays * 1 days);
        maxBid = _maxBid;
        state = AuctionState.Open;
    }

    function placeBid() external payable auctionOpen {
        require(msg.value > 0, "La puja debe ser mayor que cero");
        require(msg.value <= maxBid, "Puja excede el maximo permitido");
        require(!hasAlreadyBid(msg.sender), "Ya has pujado");

        uint256 deposit = (msg.value * DEPOSIT_PERCENTAGE) / 100;
        require(msg.value >= deposit, "Deposito insuficiente");

        bids.push(Bid(payable(msg.sender), msg.value, block.timestamp, false));
        bidders.push(msg.sender);

        if (bids.length == MAX_BIDDERS) {
            _closeAuction();
        }

        emit BidPlaced(msg.sender, msg.value);
    }

    function closeAuction() external onlyOwner {
        require(state == AuctionState.Open, "Subasta ya cerrada");
        _closeAuction();
    }

    function _closeAuction() private {
        state = AuctionState.Closed;
        (winner, winningPrice) = _determineWinner();
        emit AuctionClosed(winner, winningPrice);
    }

    function _determineWinner() private view returns (address payable, uint256) {
        require(bids.length > 0, "No hay pujas");

        uint256 lowest = maxBid;
        uint256 secondLowest = maxBid;
        address payable winnerAddress;
        uint256 winnerTimestamp = type(uint256).max;

        for (uint256 i = 0; i < bids.length; i++) {
            if (bids[i].amount < lowest) {
                secondLowest = lowest;
                lowest = bids[i].amount;
                winnerAddress = bids[i].bidder;
                winnerTimestamp = bids[i].timestamp;
            } else if (bids[i].amount == lowest && bids[i].timestamp < winnerTimestamp) {
                secondLowest = lowest;
                winnerAddress = bids[i].bidder;
                winnerTimestamp = bids[i].timestamp;
            } else if (bids[i].amount < secondLowest && bids[i].amount > lowest) {
                secondLowest = bids[i].amount;
            }
        }

        return (winnerAddress, bids.length == 1 ? lowest : secondLowest);
    }

    function returnDeposits() external onlyOwner {
        require(state == AuctionState.Closed, "Subasta no finalizada");

        for (uint256 i = 0; i < bids.length; i++) {
            if (bids[i].bidder != winner && !bids[i].depositReturned) {
                uint256 deposit = (bids[i].amount * DEPOSIT_PERCENTAGE) / 100;
                bids[i].depositReturned = true;
                bids[i].bidder.transfer(deposit);
                emit DepositReturned(bids[i].bidder, deposit);
            }
        }

        state = AuctionState.Completed;
    }

    function hasAlreadyBid(address bidder) public view returns (bool) {
        for (uint256 i = 0; i < bidders.length; i++) {
            if (bidders[i] == bidder) {
                return true;
            }
        }
        return false;
    }

    function getBidCount() public view returns (uint256) {
        return bids.length;
    }
}

